import React from "react";

fetch("./CompetitionsTable.json")
  .then((res) => {
    return res.json();
  })
  .then((data) => CompetitionsItem(data));

export default function CompetitionsItem(data) {
  let eventProvider = data.event_provider;
  let competitionName = data.competition_name;
  let date = data.date;
  let location = data.location;
  let worldsBids = data.worlds_bids;
  let competitionWebpageLink = data.competition_webpage.link;
  let competitionWebpageTitle = data.competition_webpage.name;

  if (data.sprung_floor) {
    let sprungFloor = <i className="fa-solid fa-check"></i>;
  } else {
    let sprungFloor = null;
  }
  if (data.prep_divisions) {
    let prepDivisions = <i className="fa-solid fa-check"></i>;
  } else {
    let prepDivisions = null;
  }
  if (data.asw_bids) {
    let aswBids = <i className="fa-solid fa-check"></i>;
  } else {
    let aswBids = null;
  }

  if (data.summit_bids && data.summit_bids_year) {
    let summitBids = `${(<i className="fa-solid fa-check"></i>)} (${
      data.summit_bids_year
    })`;
  } else if (data.summit_bids) {
    let summitBids = <i className="fa-solid fa-check"></i>;
  } else {
    let summitBids = null;
  }

  if (data.worlds_bids && data.worlds_bids_year) {
    let worldsBids = `${(<i className="fa-solid fa-check"></i>)} (${
      data.summit_bids_year
    })`;
  } else if (data.worlds) {
    let worldsBids = <i className="fa-solid fa-check"></i>;
  } else {
    let worldsBids = null;
  }

  return (
    <tr>
      <th scope="row">{eventProvider}</th>
      <td>{competitionName}</td>
      <td>{date}</td>
      <td>{location}</td>
      <td className="text-center">{sprungFloor}</td>
      <td className="text-center">{prepDivisions}</td>
      <td className="text-center">{aswBids}</td>
      <td className="text-center">{summitBids}</td>
      <td className="text-center">{worldsBids}</td>
      <td>
        <a
          href={competitionWebpageLink}
          target="_blank"
          rel="noreferrer noonpener"
        >
          {competitionWebpageTitle}
        </a>
      </td>
    </tr>
  );
}
